    /**
     * Test the LogSort.sort function using an empty list of entries.
     */
    @Test
    @DisplayName("Test Empty Entries")
    void testEmptyEntries() throws JSONException {
        LogSort sortStrategy;

        // Keep track of the start, end, and execution times of each sort method
        long startTime;
        long endTime;
        long totalTime;

        // Setup an empty entries array
        JSONArray emptyEntries = new JSONArray();

        // ID Sort
        sortStrategy = new IDSort();
        startTime = System.currentTimeMillis();
        JSONArray expectedID = sortStrategy.sort(emptyEntries);
        endTime = System.currentTimeMillis();
        totalTime = (startTime - endTime) / 1000;
        assertTrue(totalTime < 60);
        assertEquals(expectedID.toString(), emptyEntries.toString());

        // Timestamp Sort
        sortStrategy = new TimestampSort();
        startTime = System.currentTimeMillis();
        JSONArray expectedTimestamp = sortStrategy.sort(emptyEntries);
        endTime = System.currentTimeMillis();
        totalTime = (startTime - endTime) / 1000;
        assertTrue(totalTime < 60);
        assertEquals(expectedTimestamp.toString(), emptyEntries.toString());

        // Entry Type Sort
        sortStrategy = new EntryTypeSort();
        startTime = System.currentTimeMillis();
        JSONArray expectedEntryType = sortStrategy.sort(emptyEntries);
        endTime = System.currentTimeMillis();
        totalTime = (startTime - endTime) / 1000;
        assertTrue(totalTime < 60);
        assertEquals(expectedEntryType.toString(), emptyEntries.toString());

        // Component Sort
        sortStrategy = new ComponentSort();
        startTime = System.currentTimeMillis();
        JSONArray expectedComponent = sortStrategy.sort(emptyEntries);
        endTime = System.currentTimeMillis();
        totalTime = (startTime - endTime) / 1000;
        assertTrue(totalTime < 60);
        assertEquals(expectedComponent.toString(), emptyEntries.toString());

        // Field Sort
        sortStrategy = new FieldSort();
        startTime = System.currentTimeMillis();
        JSONArray expectedField = sortStrategy.sort(emptyEntries);
        endTime = System.currentTimeMillis();
        totalTime = (startTime - endTime) / 1000;
        assertTrue(totalTime < 60);
        assertEquals(expectedField.toString(), emptyEntries.toString());

        // Value Sort
        sortStrategy = new ValueSort();
        startTime = System.currentTimeMillis();
        JSONArray expectedValue = sortStrategy.sort(emptyEntries);
        endTime = System.currentTimeMillis();
        totalTime = (startTime - endTime) / 1000;
        assertTrue(totalTime < 60);
        assertEquals(expectedValue.toString(), emptyEntries.toString());
    }

